import{_ as e,c as t,o as i,ab as r}from"./chunks/framework.CUflZczI.js";const _=JSON.parse('{"title":"Kit Builds (Multicopter)","description":"","frontmatter":{},"headers":[],"relativePath":"en/frames_multicopter/kits.md","filePath":"en/frames_multicopter/kits.md"}'),a={name:"en/frames_multicopter/kits.md"},l=r('<h1 id="kit-builds-multicopter" tabindex="-1">Kit Builds (Multicopter) <a class="header-anchor" href="#kit-builds-multicopter" aria-label="Permalink to &quot;Kit Builds (Multicopter)&quot;">​</a></h1><p>Multicopter kits contain almost all the parts needed for building a PX4-compatible vehicle.</p><p>They provide a gentle introduction to building drones, as all the parts are known to work well together.</p><div class="tip custom-block"><p class="custom-block-title">Batteries not included!</p><p>Kits generally do not include:</p><ul><li><strong>Batteries</strong> — shipping regulations mean that these must usually be source separately</li><li><strong>RC Controllers</strong> — Transmitters/receivers are not included in kit builds to save costs. Many users already have a handheld ground unit, and this will need a compatible module on the vehicle.</li></ul></div><h2 id="kits" tabindex="-1">Kits <a class="header-anchor" href="#kits" aria-label="Permalink to &quot;Kits&quot;">​</a></h2><p>The following kits are currently available:</p><ul><li><a href="https://holybro.com/collections/x500-kits" target="_blank" rel="noreferrer">Holybro X500 v2 PX4 Development Kit</a> (Pixhawk 6c) (<a href="./../frames_multicopter/holybro_x500v2_pixhawk6c.html">Build instructions</a>)</li><li><a href="https://holybro.com/collections/s500/products/s500-v2-development-kit" target="_blank" rel="noreferrer">Holybro S500 Kit v2</a> (Pixhawk 6c)</li><li><a href="https://holybro.com/products/qav250-kit" target="_blank" rel="noreferrer">Holybro QAV250 Kit</a> (Pixhawk 6c)</li><li><a href="https://www.nxp.com/KIT-HGDRONEK66" target="_blank" rel="noreferrer">NXP HoverGames KIT-HGDRONEK66</a> (<a href="https://www.hovergames.com/" target="_blank" rel="noreferrer">hovergames.com</a>)</li><li><a href="https://store.3dr.com/3dr-quad-zero-kit/" target="_blank" rel="noreferrer">3DR Quad Zero</a></li></ul><h2 id="build-guides" tabindex="-1">Build Guides <a class="header-anchor" href="#build-guides" aria-label="Permalink to &quot;Build Guides&quot;">​</a></h2><p>The build guides below show how to assemble a number of kits. Many kits vary only a little between revisions (for example, the new kit might simply upgrade the flight controller used, and is otherwise identical), so these are likely to be be useful for building the kits in the section above.</p><ul><li><a href="./../frames_multicopter/holybro_x500v2_pixhawk6c.html">Holybro X500 v2 (Pixhawk 6C)</a></li><li><a href="./../frames_multicopter/holybro_x500V2_pixhawk5x.html">Holybro X500 v2 (Pixhawk 5X)</a> — Discontinued (v2 kit uses Pixhawk 6c)</li><li><a href="./../frames_multicopter/holybro_x500_pixhawk4.html">Holybro X500 v1 (Pixhawk 4)</a> — Discontinued (v2 kit uses Pixhawk 6c)</li><li><a href="./../frames_multicopter/holybro_s500_v2_pixhawk4.html">Holybro S500 v1 (Pixhawk 4)</a> — Discontinued (v2 kit uses Pixhawk 6c)</li><li><a href="./../frames_multicopter/holybro_qav250_pixhawk4_mini.html">Holybro QAV250 Kit (Pixhawk 4 mini)</a> — Discontinued (current kit uses Pixhawk 6c)</li><li><a href="./../frames_multicopter/qav_r_5_kiss_esc_racer.html">Lumenier QAV-R 5&quot; Racer (Pixracer)</a> — Discontinued</li></ul>',10),o=[l];function s(n,h,c,u,d,m){return i(),t("div",null,o)}const k=e(a,[["render",s]]);export{_ as __pageData,k as default};
